import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
//import Collapse from "@material-ui/core/Collapse";
//import ExpandLess from "@material-ui/icons/ExpandLess";
//import ExpandMore from "@material-ui/icons/ExpandMore";
import Home from "@material-ui/icons/Home";
import InsertInvitation from "@material-ui/icons/InsertInvitation";
import Mood from "@material-ui/icons/Mood";
import People from "@material-ui/icons/People";
import PeopleOutline from "@material-ui/icons/PeopleOutline";
import Badge from "@material-ui/core/Badge";
import LocalGasStation from "@material-ui/icons/LocalGasStation";
import MusicNote from "@material-ui/icons/MusicNote";
import InsertChartOutlined from "@material-ui/icons/InsertChartOutlined";
import MailIcon from "@material-ui/icons/Mail";
import AccountBalanceWallet from "@material-ui/icons/AccountBalanceWallet";
import AccountBalance from "@material-ui/icons/AccountBalance";
import Description from "@material-ui/icons/Description";
import LibraryBooks from "@material-ui/icons/LibraryBooks";
import Group from "@material-ui/icons/Group";
import InsertDriveFile from "@material-ui/icons/InsertDriveFile";

const styles = theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  },
  nested: {
    paddingLeft: theme.spacing.unit * 1
  }
});

class NestedList2 extends React.Component {
  state = {
    open: false
  };

  handleClick = () => {
    this.setState(state => ({ open: !state.open }));
  };
  //ListItemIcon makes the icon faded and does the positioning
  render() {
    const { classes } = this.props;

    return (
      <List component="nav" className={classes.root}>
        <ListItem button>
          <ListItemIcon>
            <Home />
          </ListItemIcon>
          <ListItemText inset primary="Home" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <InsertInvitation />
          </ListItemIcon>
          <ListItemText inset primary="Calendar" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <Badge badgeContent={2} color="secondary">
              <MailIcon />
            </Badge>
          </ListItemIcon>
          <ListItemText inset primary="Messages" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <Mood />
          </ListItemIcon>
          <ListItemText inset primary="Clients" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <PeopleOutline />
          </ListItemIcon>
          <ListItemText inset primary="Team Members" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <MusicNote />
          </ListItemIcon>
          <ListItemText inset primary="Inventory" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <LocalGasStation />
          </ListItemIcon>
          <ListItemText inset primary="Mileage" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <AccountBalanceWallet />
          </ListItemIcon>
          <ListItemText inset primary="Acounts & Invoices" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <AccountBalanceWallet />
          </ListItemIcon>
          <ListItemText inset primary="Payroll" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <InsertChartOutlined />
          </ListItemIcon>
          <ListItemText inset primary="Reports" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <InsertDriveFile />
          </ListItemIcon>
          <ListItemText inset primary="Forms" />
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <LibraryBooks />
          </ListItemIcon>
          <ListItemText inset primary="Templates" />
        </ListItem>
      </List>
    );
  }
}

NestedList2.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(NestedList2);
